import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <div class="footer_left">
        <p>Album and song details</p>
      </div>
      <div class="footer_center">
        <p>Player controls</p>
      </div>
      <div class="footer_right">
        <p>Volume controls</p>
      </div>
    </div>
  );
}

export default Footer;
